selector_to_html = {"a[href=\"../ref.html#ex-deinterleave\"]": "<figure class=\"align-default\" id=\"ex-deinterleave\">\n<img alt=\"ex_deinterleave\" src=\"../_images/ex_deinterleave.svg\"/><figcaption>\n<p><span class=\"caption-text\">De-interleave Z-Planes</span><a class=\"headerlink\" href=\"#ex-deinterleave\" title=\"Permalink to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#lbm-metadata\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">LBM Metadata<a class=\"headerlink\" href=\"#lbm-metadata\" title=\"Permalink to this heading\">#</a></h2><p>The primary distinction between Light-Beads Microscopy datasets and standard 2p datasets are how the data is organized on disk.</p><p>This information is stored in the <a class=\"reference external\" href=\"https://docs.scanimage.org/Appendix/ScanImage%2BBigTiff%2BSpecification.html#scanimage-bigtiff-specification\">ScanImage Metadata</a>.</p>", "a[href=\"#overview\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Overview<a class=\"headerlink\" href=\"#overview\" title=\"Permalink to this heading\">#</a></h3><p>ScanImage stores metadata about image size, frame rate, resolution, and regions of interest within the raw <code class=\"code docutils literal notranslate\"><span class=\"pre\">.tiff</span></code> file.</p><p>Each pipeline handles this metadata for you, and provides an interface to use these values throughout the pipeline.</p>", "a[href=\"#light-beads-microscopy-data\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Light Beads Microscopy Data<a class=\"headerlink\" href=\"#light-beads-microscopy-data\" title=\"Permalink to this heading\">#</a></h1><p>Current Light Beads Microscopy (LBM) data is aquired with ScanImage aquisition software.</p><p>ScanImage <a class=\"reference external\" href=\"https://docs.scanimage.org/Premium+Features/Multiple+Region+of+Interest+(MROI).html\">Multi Region Of Interest (mROI)</a> outputs raw <code class=\"docutils literal notranslate\"><span class=\"pre\">.tiff</span></code> files made up of individual <code class=\"docutils literal notranslate\"><span class=\"pre\">Regions</span> <span class=\"pre\">of</span> <span class=\"pre\">Interest</span> <span class=\"pre\">(ROI's)</span></code>.</p>", "a[href=\"#term-image-length\"]": "<dt id=\"term-image-length\">image-length</dt><dd><p>The number of pixels on the long axis of the raw <code class=\"code docutils literal notranslate\"><span class=\"pre\">.tiff</span></code> file.</p></dd>", "a[href=\"#term-roi_height_px\"]": "<dt id=\"term-roi_height_px\">roi_height_px</dt><dd><p>The size of the <a class=\"reference internal\" href=\"#term-region-of-interest\"><span class=\"xref std std-term\">region-of-interest</span></a> on its longest dimension.</p></dd>", "a[href=\"#term-Field-of-view\"]": "<dt id=\"term-Field-of-view\">Field-of-view</dt><dd><p>The total size (um) of the raw stitched image with no trimming operations.</p></dd>", "a[href=\"#term-region-of-interest\"]": "<dt id=\"term-region-of-interest\">region-of-interest</dt><dd><p>A set of 1 or more 2D planes which are stitched together to form the full image.</p></dd>", "a[href=\"#term-pixel-resolution\"]": "<dt id=\"term-pixel-resolution\">pixel-resolution</dt><dd><p>The size, in micron, of each pixel.</p></dd>", "a[href=\"#usage\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Usage<a class=\"headerlink\" href=\"#usage\" title=\"Permalink to this heading\">#</a></h3><p>Each pipeline comes stocked with methods to retrieve imaging metadata.</p>", "a[href=\"#term-image-width\"]": "<dt id=\"term-image-width\">image-width</dt><dd><p>The number of pixels on the short, slow-galvo axis of the raw <code class=\"code docutils literal notranslate\"><span class=\"pre\">.tiff</span></code> file.</p></dd>", "a[href=\"#frame-ordering\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Frame Ordering<a class=\"headerlink\" href=\"#frame-ordering\" title=\"Permalink to this heading\">#</a></h2><p>ScanImage saves raw tiffs with each z-depth and timepoint interleaved [zT]:</p>", "a[href=\"#array-terminology\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Array Terminology<a class=\"headerlink\" href=\"#array-terminology\" title=\"Permalink to this heading\">#</a></h2><p>Light-beads microscopy is a 2-photon imaging paradigm based on <a class=\"reference external\" href=\"https://docs.scanimage.org/index.html\">ScanImage</a> acquisition software.</p>", "a[href=\"../ref.html#multipage-tiff\"]": "<figure class=\"align-default\" id=\"multipage-tiff\">\n<img alt=\"Multipage Tiff\" src=\"../_images/gen_array_page.gif\"/>\n<figcaption>\n<p><span class=\"caption-text\">MultiPage Tiff</span><a class=\"headerlink\" href=\"#multipage-tiff\" title=\"Permalink to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#term-roi_width_px\"]": "<dt id=\"term-roi_width_px\">roi_width_px</dt><dd><p>The size of the <a class=\"reference internal\" href=\"#term-region-of-interest\"><span class=\"xref std std-term\">region-of-interest</span></a> on its shortest dimension.</p></dd>", "a[href=\"#term-num_pixel_xy\"]": "<dt id=\"term-num_pixel_xy\">num_pixel_xy</dt><dd><p>The number of pixels [X, Y] in each <a class=\"reference internal\" href=\"#term-region-of-interest\"><span class=\"xref std std-term\">region-of-interest</span></a>.</p></dd>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
